from decimal import Decimal

def compute_first_last_k_digits(n: int, k: int) -> tuple:
    if n <= 1000:
        q1 = str(n ** n)[:k]
    else:
        x = Decimal(n)
        q1 = str(int(10 ** (x * x.log10() % 1 + k - 1)))
    q2 = str(pow(n, n, 10 ** k)).zfill(k)
    return (q1, q2)

